import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <div className="navbar navbar-ligth bg-primary">
        <a className="text-white" href="/">Tennis App</a>
      </div>
      <div className="container p-5">
      <div className="card"></div>
      </div>

      </div>
    );
  }
}

export default App;
